// src/components/GameBoard.js
import React from 'react';
import './GameBoard.css';

const GameBoard = () => {
  return (
    <div className="game-board">
      {/* Platforms */}
      <div className="platform">
        {/* Blue Blocks */}
        <div className="block blue"></div>
        <div className="block blue"></div>
        <div className="block blue"></div>
        <div className="block blue"></div>
        <div className="block blue"></div>
        {/* Red Blocks */}
        <div className="block red"></div>
        <div className="block red"></div>
      </div>
    </div>
  );
};

export default GameBoard;
